import React from "react";
import "./Sidebar.css";
import SidebarRow from "./SidebarRow";
import {Chat, EmojiFlags, LocalHospital, People} from "@material-ui/icons";

function Sidebar(){
  return <div className="sidebar">
    <SidebarRow title="Pages"/>
    <SidebarRow
      Icon={LocalHospital}
      title="Sonny Sangna"
    />
    <SidebarRow  Icon={EmojiFlags()} />

  </div>
}

export default Sidebar;
